import React from "react";

function Social(){
    return(
      
        <ul className="list-group">
        <li className="list-group-item">
          <input type="checkbox" id="facebook" />
          <label></label>
          
        </li> 
          
        <li className="list-group-item">
          <input type="checkbox" id="Tweeter" />
          <label></label>
         
        </li>
          
        <li className="list-group-item">
          <input type="checkbox" id="Instagram" />
          <label></label>
        </li>
          
      </ul>
    
);
}
export default Social
